@base <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

<Actor:Customer> rdf:type owl:Class .
<Item:card> rdf:type owl:Class .
<System:ATM> rdf:type owl:Class .
<Function:dispense> rdf:type owl:ObjectProperty .
<Item:money> rdf:type owl:Class .

<Function:dispense> rdfs:domain <System:ATM> .
<Function:dispense> rdfs:range <Item:money> .

<Actor:Customer> rdfs:subClassOf [
  rdf:type owl:Restriction ;
  owl:onProperty <Function:dispense> ;
  owl:someValuesFrom <Item:card>
] .

<System:ATM> rdfs:subClassOf [
  rdf:type owl:Restriction ;
  owl:onProperty <Function:dispense> ;
  owl:someValuesFrom <Item:money>
] .
